import React, { Component } from 'react';
import './App.css';

class App extends Component {


  // Fetch passwords after first mount
  componentDidMount() {
    this.getPasswords();
  }

  getPasswords = () => {
    // Get the passwords and store them in state
    fetch('/api/passwords')
      .then(res => res.json())
      .then(passwords => this.setState({ passwords }));
  }

  render() {

    return (
      <div className="App">
        hello
      </div>
    );
  }
}

export default App;
